import react,{Component} from 'react'
export default class AppInput9_10 extends Component{
    constructor(props)
    {
        super(props);
        this.state={
            'fname':'',
            'lname':''
        }
    }

    render()
    {
        return(
            <div>
                <input name='fname'
                type='text'
                placeholder='enter the firstname'
                value='this.state.lname'
                />
                <br/><br/>

                <input name='lname'
                type='text'
                placeholder='enter the lastname'
                value='this.state.lname'
                />
                <br/><br/>

                <button>Submit</button><br/>
            </div>
        );
    }
}
